package model;import java.util.Date;/** * Created by dodo on 20/05/16. */public class StickNote {    private int id;    private Date dtCriacao;    private String titulo;    public void setId(int id) {        this.id = id;    }    public void setDtCriacao(Date dtCriacao) {        this.dtCriacao = dtCriacao;    }    public void setTitulo(String titulo) {        this.titulo = titulo;    }    public void setNota(String nota) {        this.nota = nota;    }    public void setIndConcluido(int indConcluido) {        this.indConcluido = indConcluido;    }    private String nota;    private int indConcluido;    public int getId() {        return id;    }    public Date getDtCriacao() {        return dtCriacao;    }    public String getTitulo() {        return titulo;    }    public String getNota() {        return nota;    }    public int getIndConcluido() {        return indConcluido;    }}